import React from 'react';

function ChannelList({ channels, onChannelSelect }) {
    return (
      <div className="channel-list">
        <h2 className="channel-name">Channels</h2> {/* Use the same class for the heading */}
        {channels.map((channel) => (
          <div key={channel.id} className="channel-name" onClick={() => onChannelSelect(channel)}>
            {channel.name}
          </div>
        ))}
      </div>
    );
  }
export default ChannelList;
